import React from 'react';
import Jewel from './noun_jewel_2498038.svg';

const SVG = ({color, size}) => (
    <svg fill={color} width={size} height={size}>
        <use xlinkHref={`${Jewel}`} />
    </svg>
);

export default SVG;
